// App.js
import React, { useState } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link,
    useNavigate
} from 'react-router-dom';
import ArticleSelection from './ArticleSelection';
import GraphPage from './GraphPage';

function App() {
    const [selectedArticles, setSelectedArticles] = useState([]);
    return (
        <Router>
            <Routes>
                <Route path="/" element={<ArticleSelection setSelectedArticles={setSelectedArticles} />} />
                <Route path="/graph" element={<GraphPage selectedArticles={selectedArticles} />} />
            </Routes>
        </Router>
    );
}

export default App;
